}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16">  <path d="M3,7A3,3,0,1,1,6,4,3.0033,3.0033,0,0,1,3,7Z" fill="#464646"/>  <path d="M3,14a3,3,0,1,1,3-3A3.0033,3.0033,0,0,1,3,14Z" fill="#464646"/>  <path d="M15,7H9V1h6Z" fill="#464646"/>  <path d="M15,14H9V8h6Z" fill="#464646"/>  <rect x="7" width="1" height="16" fill="#464646"/>  <rect x="10" y="2" width="4" height="4" fill="#55b991"/>  <rect x="10" y="9" width="4" height="4" fill="#55b991"/>  <circle cx="3" cy="11" r="2" fill="#55b991"/>  <circle cx="3" cy="4" r="2" fill="#55b991"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
